import{_ as e,q as a,p as s,aE as t}from"./chunks/framework.-H45_L2h.js";const i="/assets/1-2.1CbzpTn_.png",r="/assets/3-3.B1f5FoyE.png",o="/assets/4-1.BZ5tyz8C.png",p="/assets/image-20210402144617193.ZkgisdVw.png",n="/assets/image-20210402144656502.BofHWtGS.png",l="/assets/image-20210402144959071.BdjpNuZ3.png",g="/assets/image-20210402145046897.48DmyBST.png",c="/assets/image-20210402145111236.BQYB1bdJ.png",d="/assets/10-1.DD1rUnsv.png",m="/assets/image-20210402150133974.CcNQAKkD.png",N=JSON.parse('{"title":"PowerDesigner 安装教程","description":"","frontmatter":{"title":"PowerDesigner 安装教程","date":"2023-05-31T15:34:50.000Z","categories":["教程文章"],"tags":["PowerDesigner"],"showComment":false},"headers":[],"relativePath":"教程文章/PowerDesigner安装教程.md","filePath":"教程文章/PowerDesigner安装教程.md","lastUpdated":1723022138000}'),_={name:"教程文章/PowerDesigner安装教程.md"},h=t('<h1 id="powerdesigner-安装教程" tabindex="-1">PowerDesigner 安装教程 <a class="header-anchor" href="#powerdesigner-安装教程" aria-label="Permalink to &quot;PowerDesigner 安装教程&quot;">​</a></h1><h2 id="安装图文教程" tabindex="-1">安装图文教程 <a class="header-anchor" href="#安装图文教程" aria-label="Permalink to &quot;安装图文教程&quot;">​</a></h2><p>1、解压 PowerDesigner 安装文件，并双击 PowerDesigner.exe；</p><p>2、欢迎来到 PowerDesigner 安装界面，点击 Next</p><p><img src="'+i+'" alt="1-2" loading="lazy"></p><p>3、一定要选择 Trial，再点击 Next，不要选择其它，这一步如果选择错，后面破解是不行的。</p><p><img src="'+r+'" alt="3-3" loading="lazy"></p><p>4、选择 Hong Kong，点击 I AGREE，再点击 Next；</p><p><img src="'+o+'" alt="4-1" loading="lazy"></p><p>5、选择一个安装目录，默认是安装在 C 盘。再点击 Next；</p><p><img src="'+p+'" alt="image-20210402144617193" loading="lazy"></p><p>6、点击 next 下一步</p><p><img src="'+n+'" alt="image-20210402144656502" loading="lazy"></p><p>7、点击 General 和 Notaion，再点击 Next；</p><p><img src="'+l+'" alt="image-20210402144959071" loading="lazy"></p><p>8、点击 next 下一步</p><p><img src="'+g+'" alt="image-20210402145046897" loading="lazy"></p><p>9、直接点击 Next；进入正在安装界面</p><p><img src="'+c+'" alt="image-20210402145111236" loading="lazy"></p><p>10、点击 Finish（安装完成）</p><p><img src="'+d+'" alt="10-1" loading="lazy"></p><h2 id="破解步骤" tabindex="-1">破解步骤 <a class="header-anchor" href="#破解步骤" aria-label="Permalink to &quot;破解步骤&quot;">​</a></h2><p>1、将 PowerDesigner 破解文件解压，然后，你能看到一个“pdflm16.dll”文件；</p><p>2、将“pdflm16.dll”复制并覆盖到你软件安装的根目录中，一定要是此软件的安装根目录；例如：我这里就直接复制到</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>D:\\Program Files\\PowerDesigner 16</span></span></code></pre></div><h2 id="汉化步骤" tabindex="-1">汉化步骤 <a class="header-anchor" href="#汉化步骤" aria-label="Permalink to &quot;汉化步骤&quot;">​</a></h2><p>1、将 PowerDesigner 汉化文件解压，然后你能看到很多文件；</p><p>2、Ctrl+A（全选）所有文件，复制并覆盖到你软件安装的根目录中；</p><p>3、如果点击 PdShell16.exe 不能正常启动，请点击 pdlegacyshell16.exe 启动；</p><p><img src="'+m+'" alt="image-20210402150133974" loading="lazy"></p><p>注意：</p><p>最近有很多人问：PowerDesigne 破解版 怎么找不到右边表的工具栏？工具栏不见了怎么显示出来？</p><p>只需要去：<strong>工具</strong> - <strong>工具栏</strong> - <strong>显示首选项</strong>。里面调出来就行了，自定义工具栏里面！</p>',33),P=[h];function D(w,u,x,f,y,b){return s(),a("div",null,P)}const k=e(_,[["render",D]]);export{N as __pageData,k as default};
